import React from "react";
import "./App.css";
import Header from "./components/Header";

const Body: React.FC = () => {
  function counter () {
    return <h1>hello</h1>
  }
  return (
    <>
      <div className="col">
        <div>
          <span>Restaurant name:</span>
          <input
            id="searchName"
            className="searchName"
            type="text"
          />
        </div>
        <div>
          <div>Review:</div>
          <textarea name="comment"></textarea>
        </div>
        <table>
          <tr>
            <td>Rest1</td>
            <td>Rating1</td>
          </tr>
          <tr>
            <td>Rest2</td>
            <td>Rating2</td>
          </tr>
          <tr>
            <td>Rest3</td>
            <td>Rating3</td>
          </tr>
          <tr>
            <td>Rest4</td>
            <td>Rating4</td>
          </tr>
        </table>
      </div>
    </>
  );
};

const App: React.FC = () => {
  return (
    <div className="body">
      <Header />
      <Body />
    </div>
  );
};

export default App;
